import React from 'react';
import SSVLogo from '../assets/img/ssv.png';
import FortaLogo from '../assets/img/forta.svg';
import MoonbeamLogo from '../assets/img/moonbeam.svg';
import StreamerLogo from '../assets/img/streamr.png';

const goodCases = [
  {
    name: 'Forta',
    logo: FortaLogo,
    caseInfo:
      'Lorem ipsum dolor sit amet consectetur adipisicing elit. Quas cum cumque minus iste veritatis provident at.',
    isBig: false,
  },
  {
    name: 'SSV',
    logo: SSVLogo,
    caseInfo:
      'Lorem ipsum dolor sit amet consectetur adipisicing elit. Quas cum cumque minus iste veritatis provident at.',
    isBig: true,
  },
  {
    name: 'Streamer',
    logo: StreamerLogo,
    caseInfo:
      'Lorem ipsum dolor sit amet consectetur adipisicing elit. Quas cum cumque minus iste veritatis provident at.',
    isBig: true,
  },
  {
    name: 'Moonbeam',
    logo: MoonbeamLogo,
    caseInfo:
      'Lorem ipsum dolor sit amet consectetur adipisicing elit. Quas cum cumque minus iste veritatis provident at.',
    isBig: false,
  },
];

const CaseCard = () => {
  return (
    <div className="p-0 md-p-5">
      <h2 className="white fs-l3 fw-900 text-center">Наши самые успешные кейсы</h2>
      <div className="flex flex-wrap p-0 md-p-5 case-card container">
        {goodCases.map((obj) => (
          <div key={obj.name} className="card md-p-5">
            <div className="face face1">
              <div className="content">
                {obj.isBig ? (
                  <img className="imgSmall" src={obj.logo} alt={obj.name} />
                ) : (
                  <img src={obj.logo} />
                )}
              </div>
            </div>
            <div className="face face2">
              <div className="content">
                <h2 className="text-center">{obj.name}</h2>
                <p>{obj.caseInfo}</p>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default CaseCard;
